We know that a matrix is not invertible if and only if its determinant is equal to zero.  So, we need to find the determinant of this matrix.  The determinant of a $2 \times 2$ matrix is given by $\det \begin{pmatrix} a & b \\ c & d \end{pmatrix} = ad - bc.$  Therefore, the determinant of our matrix is given by \begin{align*}
\det \begin{pmatrix} 1 + x & 7 \\ 3 - x & 8 \end{pmatrix} &= (1 + x)(8) - (7)(3 - x) \\
&= 8 + 8x - 21 + 7x \\
&= 15x - 13.
\end{align*}

Consider the matrix $A=\begin{pmatrix} 1 + x & 7 \\ 3 - x & 8 \end{pmatrix}$ and the determinant of $A$, denoted by $\det(A)$. Since the determinant of $A$ is the product of the diagonals minus the product of the off-diagonal entries, we have

\begin{align*}
\det(A) &= (1+x)\cdot8-(7)\cdot(3-x)\\
&= 8+8x-21+7x\\
&= 15x-13.
\end{align*}

Therefore, we have
\begin{align*}
(1 + x)(8) - (7)(3 - x) &= 0 \\
8 + 8x - 21 + 7x &= 0 \\
15x &= 13 \\
x &= \boxed{\frac{13}{15}}
\end{align*}

